import PropTypes from "prop-types";

const Header = ({ title }) => {
  return (
    <div>
      <header>
        <h1>title={"Task tracker"}</h1>
      </header>
    </div>
  );
};

Header.PropTypes = {
  title: PropTypes.string,
};

export default Header;
